import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./componets/navbar";
import Counters from "./componets/counters";

function App() {
  return (
    <React.Fragment>
      <Navbar />
      <main className="container-fluid">
        <Counters />
      </main>
    </React.Fragment>
  );
}

export default App;
